import {useState} from 'react';
import RenderAuth from "./AuthPage";

function Login(){
    const [authValue, setAuthValue] = useState(1);
    const clickAuth = (e) => {
        e.preventDefault();  // Previene la recarga de la página
        setAuthValue(0);     // Cambia el valor de authValue
    };
    return( 
        <div className="Main">
            <div className="textUserContent">
                <h2>Ingresar</h2>
            </div>
            <div className="userContent">
                <input></input>
            </div>
            <div className="passwordContent">
                <input></input>
            </div>
            <div className="createContent">
                <RenderAuth value={authValue}/>
                <a href='#' onClick={clickAuth}><label></label></a>
            </div>
            <div className="buttonContent"></div>
        </div>
    );
}
export default Login;
